/* Modal background */
    .modal {
        position: fixed;
        z-index: 9999; /* Ensure it's above everything */
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        overflow: auto;
        background-color: rgba(0, 0, 0, 0.5); /* Black background with transparency */
        display: flex;
        align-items: center;
        justify-content: center;
    }

    /* Modal content box */
    .modal-content {
        background-color: #fff;
        padding: 20px;
        border-radius: 10px;
        max-width: 500px;
        width: 100%;
        position: relative;
    }

    /* Close button (X) */
    .close {
        position: absolute;
        top: 10px;
        right: 15px;
        font-size: 25px;
        cursor: pointer;
    }

